import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles({
    block: {
        padding: '30px 30px',
        boxShadow: '0px 5px 20px 0px grey',
        position: 'sticky',
        overflow: 'hidden'
    },
    pageInfo: {
        backgroundColor: 'blue',
        position: 'absolute',
        top: 0
    },
    buttons: {}
})

export default useStyles
